.app-logo img {
  max-height: 56px;
  width: auto;
  background: transparent;

<body class="font-sans antialiased">
  <div id="root"></div>
<script>
(function(){
  const BRAND_TEXT = "Forge - IOCs & Object Create";
  const LINKEDIN = "https://linkedin.com/in/dhaidan";
  const CREATOR_TEXT = "by Dhaidan Aljumah";

  const logoSvg = `
    <svg class="forge-brand-logo" viewBox="0 0 24 24" fill="none" aria-hidden="true">
      <path d="M12 2l7 4v6c0 5-3 9-7 10-4-1-7-5-7-10V6l7-4z" stroke="currentColor" stroke-width="1.8"/>
      <path d="M9 12l2 2 4-5" stroke="currentColor" stroke-width="1.8" stroke-linecap="round" stroke-linejoin="round"/>
    </svg>
  `;

  function tryPatch(){
    // Patch the big title (usually has gradient classes)
    const titleEl = document.querySelector('h1.bg-gradient-to-br, h1[class*="bg-gradient-to-"]');
    if(titleEl){
      titleEl.textContent = BRAND_TEXT;

      // Ensure logo exists before title
      if(!titleEl.dataset.forgePatched){
        const wrap = document.createElement('div');
        wrap.className = 'forge-brand-wrap';

        const logoHolder = document.createElement('span');
        logoHolder.innerHTML = logoSvg;
        // inherit existing title color/gradient by keeping title as-is
        // logo uses currentColor; set it to accent-ish by reading computed color
        wrap.appendChild(logoHolder);

        // move title into wrapper
        const parent = titleEl.parentElement;
        parent.insertBefore(wrap, titleEl);
        wrap.appendChild(titleEl);

        titleEl.dataset.forgePatched = "1";
      }
    }

    // Patch creator text
    const creatorEl = Array.from(document.querySelectorAll('*'))
      .find(el => el.childNodes && el.childNodes.length === 1 && el.textContent && el.textContent.trim() === "by Dhaidan Aljumah");
    if(creatorEl) creatorEl.textContent = CREATOR_TEXT;

    // Patch LinkedIn href(s)
    document.querySelectorAll('a[href*="linkedin.com/in/"]').forEach(a=>{
      const href = a.getAttribute('href') || "";
      if(href.includes("dhaidan")) a.setAttribute('href', LINKEDIN);
    });

    // If there's a text version of the LinkedIn URL, replace it
    document.querySelectorAll('a').forEach(a=>{
      if((a.textContent||"").includes("dhaidan")) a.textContent = "linkedin.com/in/dhaidan";
    });

    // Done when title found
    return !!titleEl;
  }

  // Retry a few times because app renders after JS loads
  let tries = 0;
  const t = setInterval(()=>{
    tries++;
    if(tryPatch() || tries > 50) clearInterval(t);
  }, 100);
})();
</script>

  const LINK = "https://linkedin.com/in/dhaidan";

  function patchLogo(){
    // Original brand renders as: big "P" SVG + span text "arsed"
    const targetSpan = Array.from(document.querySelectorAll('span'))
      .find(s => (s.textContent||"").trim() === "arsed" && (s.className||"").includes("bg-gradient-to-br"));
    if(!targetSpan) return false;

    const container = targetSpan.closest('div.relative.flex.items-start') || targetSpan.parentElement;
    if(!container || container.dataset.forgeLogoApplied) return true;

    container.dataset.forgeLogoApplied = "1";
    container.innerHTML = "";

    const a = document.createElement('a');
    a.href = LINK;
    a.target = "_blank";
    a.rel = "noopener noreferrer";
    a.title = "LinkedIn";

    const img = document.createElement('img');
    img.src = LOGO_URI;
    img.alt = "Forge";
    img.className = "forge-header-logo";

    a.appendChild(img);
    container.appendChild(a);
    return true;
  }

  let tries = 0;
  const t = setInterval(() => {
    tries++;
    if (patchLogo() || tries > 120) clearInterval(t);
  }, 100);
})();
